import { Iconos } from "../../Components/Iconos/Iconos"
import { BsHouseDoor, BsPerson, BsTextareaT } from 'react-icons/bs';

export const Navbar = () => {
    const home = <BsHouseDoor/>
    return(
        <div className="navbar">
            <Iconos icons={"home"} title={"Home"}/>
            <Iconos icons={ <BsPerson/> } title={"Profile"}/>
            <Iconos icons={ <BsPerson/> } title={"Skills"}/>
            <Iconos icons={ <BsTextareaT/> } title={"Contact"}/>
        </div>
    )
}
